import React from "react";
import styled from "styled-components";

export const Div = styled.div`
  text-align: center;
  margin-top: 40px;

  @media screen and (max-width: 810px) {
    margin-top: 250px;
  }
`;

export const ConstCostEstimator = () => {
  return (
    <div
      className="border"
      style={{ marginTop: 50, backgroundColor: "#F8F8F6", width: 500 }}
    >
      <h4 style={{ marginTop: 30 }}>Construction Cost Estimator</h4>
      <div>
        <input type="checkbox" />
      </div>
    </div>
  );
};
